Photo by @FransLanting World Bonobo Day overlaps with Valentine‚Äôs Day on February 14. It‚Äôs a great day to express your love for the ones dearest to you. But I hope you will also recognize our closest relatives on the great tree of life. You‚Äôre looking at a female bonobo playing with an infant by balancing it on her feet‚Äîa game any human parent can relate to. Bonobos engage in social interactions that we have long associated as exclusively human: They play, and express empathy. Compared with chimps, bonobo brains appear to be more developed in areas vital to emotions, such as feeling empathy and sensing distress in others. 

I made this image at @Lolayabonobo, a remarkable sanctuary in the Democratic Republic of Congo, where individual animals confiscated from the illegal wildlife trade are given a new lease on life. Perhaps fewer than 15,000 bonobos live in the jungles of the Congo Basin, the only place where they occur in the wild. Their survival depends on our ability to apply the same kind of compassion for them that we cherish so much in ourselves. Let‚Äôs spread the love on Valentine‚Äôs Day to our next of kin and to the organizations that take care of bonobos like the ones mentioned below. Follow me @FransLanting and @ChristineEckstrom for more stories from the world of nature.

@BonobodotOrg @thephotosociety #bonobos #apes #play #baby #love #wildlife #naturelovers #nature

While some believe that the Jaguar is the most ferocious animal in the Amazon, I personally feel that the prize goes to the Giant River Otters that call the rivers down there home. Not only are they pack hunters, but they don't seem to take crap from anyone, including Jaguars. Sometime soon I will share a video of a Jaguar hiding in a tree to get away from 6 Giant River Otters hassling it from the water below. What a sight!

