Bike packing first drew me in as a unique challenge of exploring autonomously, carrying everything with you... a combined with action, strategy in packing, and route finding. In 2020, I decided to ride across Iceland from the eastern shores to the west edge... and exciting prospect I thought would be stimulating and difficult but in the end, rewarding. While the expedition turned out to be those things (and much more), I found that more importantly - the ride was a meditation of the landscape. An immersion of sorts into each sweeping fjord, grain of sand, cracking glacier... countless intimate details that stretched from Iceland‚Äôs east to west. It was a true silver lining and showed gave me a new appreciation for the sport and it‚Äôs ability to bring me into the rhythm of a landscape. You can see the full film ‚ÄúA Line in the Sand‚Äù on my YouTube channel - link in my profile 

