‚ú®Everything is an illusion, part 2.
.
I put my thing down flip it and reverse it.What Lurks Beneath.
Finally got out and about with the camera. I planned to shoot the moonset over Storm Mountain, but clouds had other ideas (skunked!) and then went to Vermillion to try and get a sunrise over Rundle... but clouds....(double skunked). Scouted down toward Spray and found some open water and a few treasures on the shoreline given the low water that otherwise would be submerged.
So here's a partially submerged tree stump and creepy roots with a perfectly reflected Goat Mountain in the background. Spring was definitely in the air and that was ok.
Thanks for looking.
Ash‚ú®
